import { BrowserRouter as Route, Link } from 'react-router-dom';
import Sidebar from './moviesidebar';
import CardMovies from './cardmov';

import NavDashbord from './navdashbord';
import AddForm from './formadd';

function Admin() {
  return (

      <div className="App">
        <NavDashbord/>
      <Link exact  path="/ftage/dashboard">  <Sidebar/> </Link>
        <Route   path="/ftage/dashboard/add"> <AddForm></AddForm> </Route>


      </div>

  );
}

export default Admin;
